import { Button, TextField } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import img_back from '../imgs/previous.png'
import axios from 'axios';

function SignUp() {

  const clickHandler = ()=>{
    axios.post('http://localhost/brief6/Backend/user/register', formData)
    .then(function(response){
      console.log(response);
    })
    .catch(function(error){
      console.log(error);
    })
  }

  return (
    <div>
      <Link to='/'><img src={img_back} width='45' className='img_back'/></Link>
        <form onSubmit={clickHandler} className='form'>
          <TextField className='form__input' label='nom' variant='filled' type='name' required></TextField>
          <TextField className='form__input' label='prenom' variant='filled' type='name' required></TextField>
          <TextField className='form__input' label='email' variant='filled' type='email' required></TextField>
          <TextField className='form__input' label='age' variant='filled' type='number' required></TextField>
          <TextField className='form__input' label='dateNaissance' variant='filled' type='text' required></TextField>
          <Button type='submit' variant='contained' color='primary' className='form_submit'>Submit</Button>
        </form>
    </div>
  )
}

export default SignUp
